import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Code, Database, Globe, Smartphone, Server, Zap } from 'lucide-react';

const About = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const skills = [
    { name: 'HTML5', percentage: 80, icon: Code },
    { name: 'CSS3', percentage: 95, icon: Globe },
    { name: 'JavaScript', percentage: 75, icon: Code },
    { name: 'Java', percentage: 75, icon: Code },
    { name: 'NodeJS', percentage: 87, icon: Server },
    { name: 'Python', percentage: 70, icon: Code },
  ];

  const stats = [
    { number: '4+', label: 'Projects Completed' },
    { number: '6+', label: 'Years Experience' },
    { number: '500+', label: 'Hours Coded' },
    { number: '3+', label: 'Hackathons' },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { y: 50, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.6,
        ease: "easeOut",
      },
    },
  };

  return (
    <section id="about" className="section-padding relative">
      <div className="container-custom">
        <motion.div
          ref={ref}
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
          className="grid lg:grid-cols-2 gap-12 items-center"
        >
          {/* Left Column - About Text */}
          <motion.div variants={itemVariants}>
            <motion.h2 
              variants={itemVariants}
              className="text-4xl md:text-5xl font-bold mb-8"
            >
              About <span className="gradient-text">Me</span>
            </motion.h2>
            
            <motion.p variants={itemVariants} className="text-lg text-dark-300 leading-relaxed mb-6">
              Hi, I'm <span className="text-accent-500 font-semibold">Krish Desai</span>, a Grade 10 student in the 
              International Baccalaureate program with a keen interest in pursuing computer science in the future. 
              I've worked on numerous projects that have honed my skills in various programming languages and 
              software development techniques.
            </motion.p>
            
            <motion.p variants={itemVariants} className="text-lg text-dark-300 leading-relaxed mb-8">
              I'm known for being <span className="text-accent-500 font-semibold">cooperative</span>, 
              <span className="text-accent-500 font-semibold"> detail-oriented</span>, and 
              <span className="text-accent-500 font-semibold"> innovative</span>. My passion for technology 
              drives me to continuously learn and tackle complex problems, aiming to create impactful solutions 
              that can make a real difference.
            </motion.p>

            {/* Stats Grid */}
            <motion.div variants={itemVariants} className="grid grid-cols-2 gap-6">
              {stats.map((stat, index) => (
                <motion.div
                  key={index}
                  whileHover={{ scale: 1.05 }}
                  className="text-center p-4 glass-effect rounded-lg"
                >
                  <div className="text-3xl font-bold gradient-text mb-2">{stat.number}</div>
                  <div className="text-sm text-dark-300">{stat.label}</div>
                </motion.div>
              ))}
            </motion.div>
          </motion.div>

          {/* Right Column - Skills */}
          <motion.div variants={itemVariants}>
            <motion.h3 variants={itemVariants} className="text-2xl font-bold mb-8">
              My <span className="gradient-text">Skills</span>
            </motion.h3>
            
            <div className="space-y-6">
              {skills.map((skill, index) => (
                <motion.div
                  key={skill.name}
                  variants={itemVariants}
                  whileHover={{ scale: 1.02 }}
                  className="glass-effect p-4 rounded-lg"
                >
                  <div className="flex items-center justify-between mb-3">
                    <div className="flex items-center space-x-3">
                      <skill.icon size={20} className="text-accent-500" />
                      <span className="font-semibold">{skill.name}</span>
                    </div>
                    <span className="text-sm text-accent-500 font-mono">{skill.percentage}%</span>
                  </div>
                  
                  <div className="w-full bg-dark-700 rounded-full h-2">
                    <motion.div
                      initial={{ width: 0 }}
                      animate={inView ? { width: `${skill.percentage}%` } : { width: 0 }}
                      transition={{ duration: 1, delay: index * 0.1 }}
                      className="h-2 bg-gradient-to-r from-accent-500 to-primary-500 rounded-full"
                    />
                  </div>
                </motion.div>
              ))}
            </div>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
